import React from 'react';
import { useParams } from 'react-router-dom';

function MovieDetail() {
  const { id } = useParams();

  return (
    <div className="movie-detail">
      <h1>Movie Detail</h1>
      <p>Showing details for movie ID: {id}</p>
    </div>
  );
}

export default MovieDetail;
